import React from "react";
import { Menu } from "antd"
import { AppstoreOutlined, CarOutlined, LogoutOutlined, ShopOutlined, ShoppingCartOutlined, TagOutlined, UserOutlined } from "@ant-design/icons";
import { useNavigate } from "react-router-dom";
export default function SideMenu() {
    const navigate = useNavigate();
    return (
        <div className="SideMenu">

            <Menu
                onClick={(item) => {
                    navigate(item.key);
                }}
                items={[
                    {
                        label: "Dashboard",
                        icon: <AppstoreOutlined />,
                        key: '/pagequantri/dashboard',
                    },
                    {
                        label: "Đơn hàng",
                        key: '/pagequantri/donhang',
                        icon: <ShoppingCartOutlined />
                    },
                    {
                        label: "Dịch vụ",
                        key: '/pagequantri/dichvu',
                        icon: <ShopOutlined />
                    },
                    {
                        label: "Khách hàng",
                        key: '/pagequantri/khachhang',
                        icon: <UserOutlined />
                    },
                    {
                        label: "Khuyến mãi",
                        key: '/pagequantri/khuyenmai',
                        icon: <TagOutlined />
                    },
                    {
                        label: "Xe",
                        key: '/pagequantri/xe',
                        icon: <CarOutlined />,
                    },
                    {
                        label: "Đăng xuất",
                        key: '/login',
                        icon: <LogoutOutlined />,
                    },
                ]}
            >

            </Menu>
            <button onClick={handleClick => {
                localStorage.clear();
                alert("Đăng xuất khỏi tài khoản.");
                navigate('/login');
            }}>Log out</button>
        </div>
    )
}
